import React, { useState, useCallback } from 'react'
import { BrowserRouter as Router } from 'react-router-dom'

import Button from './camponents/button/Button'
import styles from './nav.module.css'
import MenuItems from './camponents/menuItems/MenuItems'

const [activeElement, setActiveElement] = useState('Profile')

const handleClick = useCallback((e: React.MouseEvent) => {
  const title: string = e.currentTarget.innerHTML
  setActiveElement(title)
}, [])

const Nav: React.FC = () => {
  return (
    <Router>
      <nav className={styles.menu}>
        <MenuItems onClick={handleClick} />
        <Button children="Tweet" />
      </nav>
    </Router>
  )
}

export default Nav
